import React from 'react';
import { useNavigate } from 'react-router-dom';
import {
  Box,
  Container,
  Typography,
  Grid,
  Card,
  CardContent,
  CardMedia,
  Button,
} from '@mui/material';
import {
  CameraAlt,
  LocalMall,
  MenuBook,
  Science,
  Toys,
  NightlightRound,
} from '@mui/icons-material';

const categories = [
  {
    id: 1,
    name: 'Telescopes',
    description: 'Discover the cosmos with our premium telescopes',
    icon: <CameraAlt sx={{ fontSize: 40 }} />,
    path: 'telescopes',
    image: 'https://images.unsplash.com/photo-1579532537598-459ecdaf39cc?auto=format&fit=crop&w=1024&q=80',
    priceRange: '₹3,999 - ₹32,999'
  },
  {
    id: 2,
    name: 'Merchandise',
    description: 'Show your love for space with NASA apparel and collectibles',
    icon: <LocalMall sx={{ fontSize: 40 }} />,
    path: 'merchandise',
    image: 'https://images.unsplash.com/photo-1517976487492-5750f3195933?auto=format&fit=crop&w=1024&q=80',
    priceRange: '₹999 - ₹1,999'
  },
  {
    id: 3,
    name: 'Study Materials',
    description: 'Learn about the universe with our educational resources',
    icon: <MenuBook sx={{ fontSize: 40 }} />,
    path: 'books',
    image: 'https://images.unsplash.com/photo-1614935151651-0bea6508db6b?auto=format&fit=crop&w=1024&q=80',
    priceRange: '₹799 - ₹1,499'
  },
  {
    id: 4,
    name: 'Space Toys',
    description: 'Educational and fun space toys for all ages',
    icon: <Toys sx={{ fontSize: 40 }} />,
    path: 'gadgets',
    image: 'https://images.unsplash.com/photo-1446776811953-b23d57bd21aa?auto=format&fit=crop&w=1024&q=80',
    priceRange: '₹3,499 - ₹24,999'
  },
  {
    id: 5,
    name: 'Collectibles',
    description: 'Rare and unique space collectibles',
    icon: <Science sx={{ fontSize: 40 }} />,
    path: 'collectibles',
    image: 'https://images.unsplash.com/photo-1518364538800-6bae3c2ea0f2?auto=format&fit=crop&w=1024&q=80',
    priceRange: '₹2,999 - ₹4,999'
  },
  {
    id: 6,
    name: 'Galaxy Lamps',
    description: 'Bring the stars into your room with our galaxy projectors',
    icon: <NightlightRound sx={{ fontSize: 40 }} />,
    path: 'home',
    image: 'https://images.unsplash.com/photo-1534447677768-be436bb09401?auto=format&fit=crop&w=1024&q=80',
    priceRange: '₹1,999 - ₹2,499'
  },
];

const Home = () => {
  const navigate = useNavigate();

  const handleCategoryClick = (category) => {
    navigate(`/category/${category.path}`);
  };

  return (
    <Box sx={{ py: 6, minHeight: '100vh' }}>
      <Container>
        <Box sx={{ mb: 8, textAlign: 'center' }}>
          <Typography
            variant="h2"
            component="h1"
            gutterBottom
            sx={{
              fontWeight: 700,
              background: 'linear-gradient(45deg, #2196F3 30%, #21CBF3 90%)',
              WebkitBackgroundClip: 'text',
              WebkitTextFillColor: 'transparent',
            }}
          >
            Welcome to Cosmos Shop
          </Typography>
          <Typography
            variant="h5"
            color="text.secondary"
            sx={{ maxWidth: 600, mx: 'auto', mb: 4 }}
          >
            Explore our universe of astronomical equipment and space merchandise
          </Typography>
        </Box>

        <Grid container spacing={4}>
          {categories.map((category) => (
            <Grid item xs={12} sm={6} md={4} key={category.id}>
              <Card
                onClick={() => handleCategoryClick(category)}
                sx={{
                  height: '100%',
                  display: 'flex',
                  flexDirection: 'column',
                  cursor: 'pointer',
                  transition: '0.3s',
                  '&:hover': {
                    transform: 'translateY(-8px)',
                    boxShadow: '0 12px 20px rgba(0,0,0,0.2)',
                  },
                  position: 'relative',
                  overflow: 'hidden',
                }}
              >
                <CardMedia
                  component="img"
                  height="200"
                  image={category.image}
                  alt={category.name}
                  sx={{ objectFit: 'cover' }}
                />
                <Box
                  sx={{
                    position: 'absolute',
                    top: 0,
                    left: 0,
                    right: 0,
                    bottom: 0,
                    bgcolor: 'rgba(0,0,0,0.4)',
                    transition: '0.3s',
                    '&:hover': {
                      bgcolor: 'rgba(0,0,0,0.2)',
                    },
                  }}
                />
                <CardContent
                  sx={{
                    flexGrow: 1,
                    zIndex: 1,
                    position: 'absolute',
                    bottom: 0,
                    left: 0,
                    right: 0,
                    color: 'white',
                    background: 'linear-gradient(to top, rgba(0,0,0,0.8), transparent)',
                    p: 3,
                  }}
                >
                  <Box sx={{ display: 'flex', alignItems: 'center', mb: 1 }}>
                    {category.icon}
                    <Typography variant="h5" component="h2" sx={{ ml: 1, fontWeight: 600 }}>
                      {category.name}
                    </Typography>
                  </Box>
                  <Typography variant="body1" sx={{ opacity: 0.9, mb: 1 }}>
                    {category.description}
                  </Typography>
                  <Typography variant="body2" sx={{ color: '#48CAE4', mb: 2 }}>
                    Price Range: {category.priceRange}
                  </Typography>
                  <Button
                    variant="contained"
                    fullWidth
                    sx={{
                      mt: 'auto',
                      background: 'linear-gradient(45deg, #2196F3 30%, #21CBF3 90%)',
                      color: 'white',
                      '&:hover': {
                        background: 'linear-gradient(45deg, #21CBF3 30%, #2196F3 90%)',
                      },
                    }}
                  >
                    Explore {category.name}
                  </Button>
                </CardContent>
              </Card>
            </Grid>
          ))}
        </Grid>
      </Container>
    </Box>
  );
};

export default Home;
